import React from "react";
import Nav from "./Homepage/Nav";
import Header from "./Homepage/Header";
import Popular from "./Homepage/Popular";
import Ratedlocations from "./Homepage/Ratedlocations";

function Homepage() {
  return (
    <>
      <Nav />
      <Header />
      <Popular />
      <Ratedlocations />
    </>
  );
}

export default Homepage;
